import me from "../../assets/me.jpeg";

function About() {

    return(
        <container>
            <div class="row">
                <div class="col">
                    <img src={me} class="img-about"/>
                </div>
                <div class="col">
                    <p>
                        This si some text about me and how wonderful I am!!
                    </p>
                </div>
            </div>
        </container>
    )
}

export default About;
